import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { ToastContainer, toast } from 'react-toastify';
import styled from 'styled-components';

import InputText from '../components/InputText';

export default function AdminLogin() {
  const navigate = useNavigate();
  useEffect(() => {
    if (localStorage.getItem('suruid')) navigate('/user/home');
  });
  return (
    <Container>
      <ToastContainer />
      <form id="login-form">
        <InputText label="Enter email id" name="email" type="text" />
        <InputText label="Enter password" name="password" type="password" />
      </form>
    </Container>
  );
}
const Container = styled.div`
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;

  #login-form {
    min-height: 340px;
    width: 300px;
    border-radius: 8px;
    box-shadow: 18px 8px 26px #bebebe, -18px -8px 26px #ffffff;
    padding: 1rem 0.5rem;
  }
`;
